import NavDropdown from "react-bootstrap/NavDropdown";
import Image from "react-bootstrap/Image";

function LanguageSelector(){
    const countries = [ "br", "es", "en" ];

    return <NavDropdown title={<Image src="/images/br.svg" width="24" roundedCircle />}>
        <NavDropdown.Item><Image src="/images/br.svg" width="24" roundedCircle /></NavDropdown.Item>
        <NavDropdown.Item><Image src="/images/es.svg" width="24" roundedCircle /></NavDropdown.Item>
        <NavDropdown.Item><Image src="/images/gb.svg" width="24" roundedCircle /></NavDropdown.Item>
    </NavDropdown>;
}

export default LanguageSelector;
